import React from 'react';

const Frame6a1a = () => {
  return (
    <div
      style={{
        width: '560px',
        minHeight: '66px',
        display: 'flex',
        flexDirection: 'column',
        boxSizing: 'border-box',
      }}
    >
      {/* Frame6a1a content goes here */}
      <div
        style={{
          width: '560px',
          height: '38px',
          color: 'rgba(238,66,55,1)',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 600,
          fontSize: '28px',
          lineHeight: '38px',
          letterSpacing: '-0.05em',
          textAlign: 'center',
          textTransform: 'capitalize',
          margin: '0 auto',
        }}
      >
        Why Choose BookTranspo?
      </div>
      <div
        style={{
          width: '560px',
          height: '28px',
          color: 'rgba(22,17,13,1)',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 400,
          fontSize: '16px',
          lineHeight: '28px',
          letterSpacing: '-0.05em',
          textAlign: 'center',
          margin: '0 auto',
        }}
      >
        Built for trust, speed, and simplicity
      </div>
    </div>
  );
};

export default Frame6a1a;
